import 'project_ds/src/App.css';
import React from 'react';
import styled from 'styled-components';

const sLogo = styled.div`
  font-family: 'bitbit';
  vertical-align: bottom;
  align-items:center;
  width : 200px;
  height: 36px;
  cursor: pointer;
  margin-left: 10px;
  text-align: center;
  font-weight: 100;
  font-size: 32px;
`;

function Logo({ children }) {

  return <sLogo>{children}</sLogo>;
}

export default Logo;
